import '../App.css';
import Header from './Header';
import Person from './Person';

const data = [
  {
    name: "Shimon",
    age: 28,
    city: "Natania",
    hoobies: "Football, Drinking",
    gender: "Male"
  },
  {
    name: "Mirit",
    age: 20,
    city: "Arad",
    hoobies: "Dencieng, Drinking",
    gender: "Feamle"
  },
  {
    name: "Gila",
    age: 27,
    city: "Beer Sheva",
    hoobies: "Sudoko",
    gender: "Female"
  },
  {
    name: "Bill",
    age: 31,
    city: "Tel Aviv",
    hoobies: "Darts",
    gender: "Male"
  }
]


function App() {
  return (
    <div>
      <Header />
      <Person 
        name={data[0].name}
        age={data[0].age}
        city={data[0].city}
        hoobies={data[0].hoobies}
      />

    </div>
  );
}

export default App;
